import React from 'react';
import {
  Nav,
  NavExpandable,
  NavItem,
  NavItemSeparator,
  NavList,
  NavGroup,
  NavVariants,
  PageHeader
} from '@patternfly/react-core';
import "./Masthead.css"

class NavHorizontalList extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      activeItem: 0
    };
    this.onSelect = result => {
      this.setState({
        activeItem: result.itemId
      });
    };
  }
  // ExperienceBU HOME EVENTS ORGANIZATIONS  Log In
  render() {
    const { activeItem } = this.state;
    const nav = (
      <Nav onSelect={this.onSelect}>
        <NavList  variant={NavVariants.horizontal}>
        <NavItem> </NavItem>
          <NavItem disabled> ExperienceBU </NavItem>
          <NavItem className='home'> HOME </NavItem>
          <NavItem className='organizations'> CLUBS </NavItem>
          <NavItem className='events' > ORGANIZATIONS </NavItem>
          <NavItem className='username'> Sign In </NavItem>
        </NavList>
      </Nav>
    );
    return (
      <PageHeader topNav={nav} style={{ backgroundColor: 'rgb(21, 21, 21)' }} />
    );
  }
}

export default NavHorizontalList
